import React from "react";
import Card from "@mui/material/Card";
import CardContent from "@mui/material/CardContent";
import Typography from "@mui/material/Typography";
import ChartImage from "../assets/chart.png"; // Importing the image

export default function Intrestpage() {
  return (
    <div
      style={{
        display: "flex",
        flexDirection: "column",
        alignItems: "center",
        width: "80%", // Set width to 80%
        margin: "auto", // Center the container
      }}
    >
      <div style={{ width: "100%" }}>
        <p
          style={{
            fontFamily: "Roboto",
            fontSize: 22,
            fontWeight: "bold",
            textAlign: "center",
          }}
        >
          Which are you most interested in?
        </p>
        <p
          style={{
            fontFamily: "Roboto",
            textAlign: "center",
          }}
        >
          Choose just one. This will help us get you started (but won't limit
          your experience).
        </p>
      </div>
      <div style={{ display: "flex" }}>
        <Card variant="outlined">
          <CardContent style={{ display: "flex", alignItems: "center" }}>
            <img src={ChartImage} alt="Chart" style={{ marginRight: "10px", width: "50px", height: "50px" }} /> {/* Displaying the image */}
            <div>
              <Typography variant="h6" component="div">
                hi
              </Typography>
            </div>
          </CardContent>
        </Card>
      </div>
    </div>
  );
}
